import React,{useState} from 'react'

import './style.css';
import Header from '../../components/header';
import RecompensaG from '../../components/recompensaG';
import RecompensaP from '../../components/recompensaP';

export default function EmpresaTrocaPonto() {
   const pontosCasa = 60;

    const recompensas= [{
        _id: 1,
        tags:"Lazer",
        img:"https://hfsbarbara.com.br/images/covid/hospedagem-segura.jpeg",
        titulo: "Diária no Hotel Fazenda",
        pontos: 650,
        possui: false,
        local: [
            {lat: 25.774, lng: -80.190},
          ]
    },{
        _id: 2,
        tags:"Bares",
        img:"https://http2.mlstatic.com/kit-6-canecas-cerveja-vidro-nadir-chop-taberna-340ml-D_NQ_NP_999278-MLB29310116062_022019-F.jpg",
        titulo: "1 litro de chop",
        pontos: 250,
        possui: false ,
        local: [
            {lat: 25.774, lng: -80.190},
          ]
    },{
        _id: 3,
        tags:"Farmacia",
        img:"data:image/jpeg;base64,",
        titulo: "5% de desconto em remédios",
        pontos: 350,
        possui: false ,

        local: [
            {lat: 25.774, lng: -80.190},
          ]
    },{
        _id: 4,
        tags:"Pets",
        img:"data:image/jpeg;base64,",
        titulo: "Banho e tosa",
        pontos: 250,
        possui: false,
        local: [
            {lat: 25.774, lng: -80.190},
          ]
    }]


    const listaTags = ["todos" , ...recompensas.map(recompensa =>  recompensa.tags).filter(unique)]
    function unique(value, index, self) { 
        return self.indexOf(value) === index;
    }

    const ativar = (el) => {
      
        if(el.classList.contains("tag_active")){
         
          return el.classList.remove("tag_active")
        }
  
        return el.classList.add("tag_active")
    
    }

   
    return (<>
        <Header voltar="true" text="casa" pontos={pontosCasa}/>
        <div className="casatroca_container">
           
                <h3>Troca de Pontos</h3><p>Prêmios para ao casal</p>

           <div  className="casatroca_tagsContainer">
               {listaTags.map(tag => {
                   return <div onClick={e => ativar(e.target)} className={`casatroca_tagName ${tag==="todos"?"tag_active":""}`} key={tag}>{tag}</div>
               })}
           </div>
               <div className="recompensas_sectionContainer"><h3>Visto recentemente</h3>
                <RecompensaG   pontos={pontosCasa} data={recompensas[0]}/>

               </div>
               <div className="recompensas_sectionContainer-pequeno"><h3>Mais Vistos</h3>
                <RecompensaP  pontos={pontosCasa} data={recompensas}/>

               </div>
               <div className="recompensas_sectionContainer"><h3>Destaque</h3>
                <RecompensaG   pontos={pontosCasa} data={recompensas[3]}/>

               </div>
            
    
        </div>
        </>
    )
}
